import React from 'react';
import Theteam from "./theteam"
import {BrowserRouter, Switch, Route} from "react-router-dom"

export default function Routes(){
    return (
        <BrowserRouter>
            <div>
                <Route exact path="/theteam"><Theteam/></Route>
            </div>
        </BrowserRouter>

    );
}
